We would like to thank everyone who have patronized, participated and supported the Soup and Champagne brand over the years. We would like to thank our sponsors and our working partners that have aligned themselves with the Soup and Champagne brand.

Soup and Champagne prides itself in cultivating Haitian culture, community, and fellowship events. We have grown significantly over the past year with attendees from all over the world, now making Soup and Champagne the best way to kick off your New Years. The execution of the 4th Annual Soup and Champagne All-White Affair was ambitious, there were several concerns that impacted some of our participants. Customer service and event experience are components that make an event great! We have a vision for our future and 2023 will be a year of focusing on all aspects of the vision. We want to make this experience a pleasurable for all that will attend! This year we had over 1500 people in attendance a growth of over 300% from 2022. 

With growth there are challenges but despite those challenges there are opportunities for improvement. We are committed to delivering on our promise. 

Photos and video can be viewed at www.SoupandChampagne.com. Be sure to tag, repost, reshare and complete the event survey so we know how to better serve YOU!

We value your time, effort and look forward to celebrating with you next year.

